    false,nt"url": null,nt"notes": "2006/07 Progress Report results for all
    schools (data as of 1/14/09)rnrnPeer indices are calculated differently depending
    on School Level.  Schools are only compared to other schools in the same School
    Level (e.g., Elementary, K-8, Middle, High)rnrn1) Elementary & K-8 - peer index
    is a value from 0-100.  We use a composite demographic statistic based on % ELL,
    % SpEd, % Title I free lunch, and % Black/Hispanic.  Higher values indicate student
    populations with higher needrnrn2) Middle & High - peer index is a value from 1.00-4.50.
     For middle schools, we use the average 4th grade proficiency ratings in ELA and
    Math for all their students that have 4th grade test scores.  For high schools,
    we use the average 8th grade proficiency ratings in ELA and Math for all their students
    that have 8th grade test scores.  Lower values indicate student populations with
    higher needrnrn3) D84 / Charter Schools - the overall score does not include the
    results of the learning environment survey. rnrn4) Schools for Transfer Students
    - consists of schools with large populations of high school students transferring
    from NYC High Schools or from out of state/country.  No peer index value is assigned
    because this set of schools is its own peer group. The reports contain 3 categories
    with one additional credit section.  Unlike the HS Progress Report, the Environment
    Category is only composed of Survey Results.  Performance measures 6-year graduation
    rate and Progress captures student level improvements in attendance, credit accumulation
    and Regents passed.  The additional credit section rewards schools demonstrating
    exceptional achievement (11 credits or more earned per year) among overage/under-credit
    populations.",nt"license_title": "License Not Specified",nt"extras":
